import React from 'react'
import Login from './login'
import {BrowserRouter as Routes, Route, BrowserRouter} from 'react-router-dom'

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path='/' element={<Login />}></Route>
        <Route path='/signup' element={<Signup />}></Route>
        </Routes>
      <Login />
    </BrowserRouter>
  )
}

export default App;
